import React from 'react'

const Blogs = () =>{
    return(
        <div className="blog">
            <div className="container">
                <div className="row">
                    <div className="col">
                        <h2 className='heading'>Latest Blogs</h2>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Blogs;
